  const resMatches = await axios
    .get(API_URL)
    .then(function(res) {
      console.log("res 7", res);
      matchData = res;
    })
    .catch(function(err) {
      console.log("err 10", err);
    });
};

setTimeout(() => {
  getMatches();
}, 5000);

matches = matchData.data;
console.log("matches 25", matches);

